public int getFirstAttemptId() {
  int min = Integer.MAX_VALUE;
  for(ApplicationAttemptId attemptId : attempts.keySet()) {
    if (attemptId.getAttemptId() < min) {
      min = attemptId.getAttemptId();
    }
  }
  return min == Integer.MAX_VALUE ? 1 : min;
}
